"use strict";function settingToggle(){var e=document.querySelector("._js-orders-settings"),n=document.querySelector("._js-orders-settings-dropdown");e.addEventListener("click",function(t){n.classList.toggle("active"),t.stopPropagation()}),document.addEventListener("click",function(t){e.contains(t.target)||n.contains(t.target)||n.classList.remove("active")})}window.addEventListener("load",function(){settingToggle()});